import React, { Component } from 'react';
import axios from 'axios'

class NewsHeadLineBox extends Component {

    getHeadline() {
        const url = 'http://newsapi.org/v2/top-headlines?' +
            'country=us&' +
            'apiKey=3c67ffab76a84ae39504830891cbaf65';
        const req = new Request(url);

        axios.get(url).then(response => {
            return response.data
        })
    }

    render() {

        const tempHeadlines = this.getHeadline()

        const headLineItems = tempHeadlines && tempHeadlines.articles.map(news => {
            return (
            <div class="media">
                <a href={news.url} ><img src={news.urlToImage} class="mr-3" alt="..." /></a>
                <div class="media-body">
                    <h5 class="mt-0">news.content</h5>)
                    {news.author}
                </div>
            </div>
        )})
                console.log
        return (
            <div>
                {headLineItems}
            </div>
        );
    }
}

export default NewsHeadLineBox;
